INSERT INTO `news` (`id`, `author`, `title`, `content`, `public`, `creation_date`) VALUES
(2, 1, 'Módisít', 'Kicserélve a tartalom', 0, '2020-02-13 11:11:00'),
(20, 1, 'Éves Leltár', 'Kedves Munkatársak!<br><br>\r\n\r\nEljött a várva a várt nap, közeleg a leltár napja!♥<br><br>\r\nA megjelenés kötelező, szabadságot nem lehet kivenni arra a napra.<br>\r\nMegértéseteket köszönjük!<br><br>\r\nKérünk titeket, hogy a gyorsabb munkavégzés érdekében, a műszak kezdete előtt 15 perccel mindenki legyen munkára kész állapotban.<br><br>\r\n\r\n\r\nIdőpont: 2019.12.06', 1, '2019-12-01 09:00:35'),
(21, 1, 'FELHÍVÁS', 'Kedves Munkavállalók!<br><br>\r\n\r\nA rendkívüli helyzetre való tekintettel, kérjük az alábbiak betartását:<br><br>\r\n\r\nRendszeres kézmosás és kézfertőtlenítés.<br>\r\nKerülje a találkozások során a megszokott kézfogást, ölelést és puszit.<br>\r\nKerülje el a készpénz használatát.<br>\r\nCsökkentse a személyes találkozók számát, használjon telefont, skype vagy viber alkalmazást, videokonferenciát.<br>\r\n2-3 naponta tisztítsa meg a mobiltelefonját.<br>\r\nNe érintse meg száját, arcát, szemét mosatlan kézzel.<br><br>\r\n\r\nKöszi', 1, '2020-03-12 12:00:12'),
(24, 1, 'Lorem Ipsum', 'In eu nibh enim. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Nulla commodo nunc eget viverra blandit. In lacus ligula, fringilla sodales efficitur vel, consequat ut sapien. Donec consequat purus orci, a auctor felis pharetra a. Donec et lorem tellus. Morbi quis ante ac massa tincidunt pretium. Sed feugiat purus pellentesque nulla suscipit tincidunt.\r\n\r\nPraesent egestas sem et urna varius, eget consectetur elit varius. Nullam a ligula nisl. Vestibulum ac iaculis sem. Etiam tempor consectetur metus sed fermentum. Vivamus ultricies pretium urna, a efficitur ipsum tincidunt at. In vitae velit consequat, tempor turpis rhoncus, luctus libero. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Cras vestibulum nisi placerat, congue felis tincidunt, imperdiet quam. Aenean luctus ex vel justo lacinia, ut accumsan enim viverra.\r\n', 0, '2020-02-11 07:26:54'),
(25, 1, 'Karácsonyi Évzáró Rendezvény', 'Kedves Munkatársak!<br><br>\r\nMost is, mint minden évben, megrendezésre kerül az éves Karácsonyi Buli!<br>\r\nVacsorával és zenés műsorral várunk Titeket!<br><br>\r\n\r\nIdőpont: 2019.12.20  18:00<br>\r\nHelyszín: Kelemen u. 42.<br>\r\nBelépő: 1800 Ft<br><br>\r\n\r\nKérünk Titeket, ha szeretnétek részt venni, a titkárságon jelezzétek Juliskának, a belépő árát is neki kell leadni.\r\n\r\n', 1, '2019-12-10 14:49:27');
